				kangarimp: 'kangaroo',
				gnomimp: 'dwarf',
				slosnimp: 'snail',
				entimp: 'scary-tree',
				squirrimp: 'squirrel',
				gravelimp: 'rock',
				mechimp: 'robot-2',
				destructimp: '',
